DROP TABLE IF EXISTS `rc_user`;
CREATE TABLE `rc_user` (
  `user_id` bigint(20) NOT NULL COMMENT '用户编号',
  `user_name` varchar(25) DEFAULT NULL COMMENT '用户名',
  `password` varchar(100) DEFAULT NULL COMMENT '用户密码',
  `phone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `phonesec` varchar(20) DEFAULT NULL,
  `real_name` varchar(10) DEFAULT NULL COMMENT '真实姓名',
  `idcard` varchar(20) DEFAULT NULL,
  `sex` varchar(2) DEFAULT NULL COMMENT '性别',
  `email` varchar(30) DEFAULT NULL COMMENT '联系邮箱',
  `type_id` int(11) DEFAULT NULL COMMENT '类型（0代表车辆用户，1代表厂商用户，2代表经销商用户，3代表农机局账户，4代表合作社账户）',
  `vip` int(2) DEFAULT NULL COMMENT '用户角色是否是vip 0不是 1是',
  `vip_start_time` datetime DEFAULT NULL,
  `vip_end_time` datetime DEFAULT NULL COMMENT 'vip结束时间',
  `audit_state` int(11) DEFAULT NULL COMMENT '审核状态（0：审核通过，1：审核未通过，2：待审核）',
  `status` int(2) DEFAULT NULL COMMENT '用户车辆绑定状况（0：无车辆信息，1：有车辆信息）',
  `image` text COMMENT '用户头像图片，采用base64保存',
  `add_time` datetime DEFAULT NULL,
  `add_user` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

